    "url": "/isomerpages-basic-1/page-A/",
    "title": "화암사소개",
    "content":"도솔산화암사 마음은 자유롭게, 세상은 아름답게 도솔산화암사에서는 더불어 사는 사회, 사랑의 활동이 전해주는 풍요로움은 널리 전하고자 합니다. 도솔산화암사는 다양한 봉사활동을 하며 더 나은 내일을 만들기 위해 지속적으로 노력하고 있습니다. 단 한 번의 행동으로도 지역사회에 변화를 가져올 수 있습니다. 여러 대중들의 힘을 합한다면 전 세계에 큰 영향을 미칠 것입니다. 인사말 2007년 5월 도솔산 아래에 작은 밭을 만들었습니다. 사찰은 단순히 기도하고 법회보고 교육하는 장소가 아니라, 삶에 지친 세상 사람들에게 희망과 용기, 그리고 위로를 주는 공간이 되어야 합니다. 그리하여 다시 신바람나게 살고자하는 욕구가 샘솟게 하는 정신적인 서비스를 제공하는 곳으로 인식 전환이 필요합니다. 사찰은 시대정신이 반영된 소통의 공간이 되어야 합니다. 부처님 말씀대로 행하고 우리의 기도가 온전히 회향할 수 있는 공덕의 밭을 여기 가까이 마음 모을 수 있는 불자님들과 함께 만들었습니다. 아무리 작은 등불이라도 어둠을 밝힐 수 있듯이, 시작은 작고 미약하지만 그 속에 늘 푸르고 성실한 마하반야바라밀의 부처님의 알맹이가 자라도록 노력하겠습니다. 더불어 신도들의 모든 헌공을 철저히 사회에 환원할 것입니다. 화암사는 사회복지 증진을 목표로 정진하고 있으며, 도솔노인복지센터 운영을 통해 도솔산 화암사의 이상인 사회복지를 실현해 나가고 있습니다. 아울러 화암사는 끊임없는 기도와 정진을 생명으로 하는 수행의 요람입니다. 저희 화암사에 오시는 모든 분들이 보현보살의 눈과 관세음보살의 손과 지장보살의 마음으로 정진하시길 축원합니다. – 덕향 혜광 합장",
